import React from 'react';
import style from '../articles.module.css';

const PostData = (props) => {
    return(
        <div className={style.articlePostData}>
            <div>
                Date:
                <span>{props.data.date}</span>
            </div>
            <div>
                Author:
                <span>{props.data.author}</span>
            </div>
        </div>
    )
}

export default PostData;
